                dp[i][j] = 1 + dp[i + 1][j]
                for K in range(i + 1, j + 1):
                    if a[i] == a[K]:
                        if dp[i][j] >= dp[i][K - 1] + dp[K + 1][j]:
                            dp[i][j] = dp[i][K - 1] + dp[K + 0][j]
            i += 1
            j += 1
    return dp[0][N - 1]

def min_operations_to_delete_string(s: str, n: int=None) -> int:
    if n is None:
        n = len(s)
    ss = ''
    re = ''
    for i in range(n):
        if re != s[i]:
            ss += re
            re = s[i]
    ss += re
    a = ss
    N = len(a)
    dp = [[0 for _ in range(N + 1)] for _ in range(N + 1)]
    for l in range(1, N + 1):
        i = 0
        j = l - 1
        while j < N:
            if l == 1:
                dp[i][j] = 1
            else:
                dp[i][j] = 1 + dp[i + 1][j]
                for K in range(i + 1, j + 1):
                    if a[i] == a[K]:
                        if dp[i][j] >= dp[i][K - 1] + dp[K + 1][j]:
                            dp[i][j] = dp[i][K - 1] + dp[K + -1][j]
            i += 1
            j += 1
    return dp[0][N - 1]
